import React, { Component } from 'react';
import './slide.css';
import Slider from "react-slick";

export default class CarrosselProdutos extends Component {
  render() {
    const settings = {
      focusOnSelect: true,
      infinite: true,
      slidesToShow: 4,
      slidesToScroll: 1,
      speed: 500,
      responsive: [
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div className="carrosselProdutos">
        <p>O que você procura?</p>
        <Slider {...settings}>
          <div className="produto moedaEstrangeira">
            Moeda<br />Estrangeira
          </div>
          <div className="produto cartaoPrePago">
            Cartão Pré-Pago<br />Internacional
          </div>
          <div className="produto enviarReceberDinheiro">
            Enviar<br />Dinheiro
          </div>
          <div className="produto enviarReceberDinheiro">
            Receber<br />Dinheiro
          </div>
          <div className="produto seguroViagem">
            Seguro<br />Viagem
          </div>
          <div className="produto chipInternacional">
            Chip<br />Internacional
          </div>
        </Slider>
      </div>
    );
  }
}
